  `pricing_plan_type` int(1) NOT NULL DEFAULT '0',
  `pricing_plan_started_on` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

